Kolejna spontaniczna weed rapsesja w @studiopalisie owocuje wspólną kompilacją zwrotek w wykonaniu Mistika(freestyle), OZMa, Freona z A.D.H.D, Dżejpy. Za muzykę odpowiada oczywiście wujek Opiat. Zdjęcie jak i gifa wykonał @Tarniu. Kawałek jest małą namiastką tego co będzie można już niedługo usłyszeć na dużej kooperacji wrocławskich raperów na KODEX 5.

